// A utility function to find the vertex with minimum distance
// value, from the set of vertices not yet included in shortest
// path tree
int minDistance(int dist[], bool sptSet[])
{
	// Initialize min value
	int min = INT_MAX, min_index;

	for (int n = 0; n < NUMNODE; n++)
		if (sptSet[n] == false && dist[n] <= min)
			min = dist[n], min_index = n;

	return min_index;
}

// Function to print shortest path from source to j
// using parent array
void printPath(int parent[], int j, std::vector<int> *path)
{
	// Base Case : If j is source
	if (parent[j] == -1)
		return;

	printPath(parent, parent[j], path);
	path->push_back(j);
}

// A utility function to print the constructed distance
// array
void printSolution(int dist[], int n, int parent[], int src)
{
	for (int i = 1; i < NUMNODE; i++)
	{
		printPath(parent, i, &m_paths[src][i]);
	}
}

// Function that implements Dijkstra's single source shortest path
// algorithm for a graph represented using adjacency matrix
// representation
void djikstra(int graph[NUMNODE][NUMNODE], int src)
{
	int dist[NUMNODE];  // The output array. dist[i] will hold
						// the shortest distance from src to i

						// sptSet[i] will true if vertex i is included / in shortest
						// path tree or shortest distance from src to i is finalized
	bool sptSet[NUMNODE];

	// Parent array to store shortest path tree
	int parent[NUMNODE];
	parent[src] = -1;


	// Initialize all distances as INFINITE and stpSet[] as false
	for (int i = 0; i < NUMNODE; i++)
	{
		dist[i] = INT_MAX; //set all distances to infinity
		sptSet[i] = false; //not included in the shortest path
	}

	// Distance of source vertex from itself is always 0
	dist[src] = 0;

	// Find shortest path for all vertices
	for (int count = 0; count < NUMNODE - 1; count++)
	{
		// Pick the minimum distance vertex from the set of
		// vertices not yet processed. u is always equal to src
		// in first iteration.
		int u = minDistance(dist, sptSet);

		// Mark the picked vertex as processed
		sptSet[u] = true;

		// Update dist value of the adjacent vertices of the
		// picked vertex.
		for (int n = 0; n < NUMNODE; n++)

			// Update dist[v] only if is not in sptSet, there is
			// an edge from u to v, and total weight of path from
			// src to v through u is smaller than current value of
			// dist[v]
			if (!sptSet[n] && graph[u][n] &&
				dist[u] + graph[u][n] < dist[n])
			{
				parent[n] = u;
				dist[n] = dist[u] + graph[u][n];
			}
	}

	// print the constructed distance array
	printSolution(dist, NUMNODE, parent, src);
}


void init_djikstra()
{
	int graph[NUMNODE][NUMNODE] = { 0 };

	//! Initialize Nodes and Edges of the Graph
	initializeNodes();
	initializeEdges(graph);

	//! Compute the shortest path from all nodes to all nodes
	for (int i = 0; i<NUMNODE; i++)
	{
		djikstra(graph, i);
	}

	//! print all the paths

	//! for the node l
	for (int l = 0; l<NUMNODE; l++)
	{
		//! and for all possible destinations
		for (int i = 0; i<NUMNODE; i++)
		{
			//print the start index and it's coordinates
			//	printf("%d (%d, %d)", l, nodes.at(l)->pos.first, nodes.at(l)->pos.second);
			for (int k = 0; k<(int)m_paths[l][i].size(); k++)
			{
				//! print all the connecting nodes to the goal
				int index = m_paths[l][i].at(k);
				//		printf("%d ", index);
				//		printf(" (%d ; %d) ", nodes.at(index)->pos.first, nodes.at(index)->pos.second);
			}
			//	printf("\n");
		}
	}
}

