// Compute the force from the goal. [Units in mm]
static void force2Goal(double* force2Goal_x, double* force2Goal_y, double goal_x, double goal_y, double pos_x, double pos_y)
{
	// Special values to not have a goal
	if ((goal_x == NO_GOAL) && (goal_y == NO_GOAL))
	{
		*force2Goal_x = 0;
		*force2Goal_y = 0;
		return;
	}
	
	// X and Y
	double dist2Goal_x = goal_x - pos_x;
	double dist2Goal_y = goal_y - pos_y;

	// Transform in Pho and Theta
	double dist2Goal_norm = sqrt(dist2Goal_x*dist2Goal_x + dist2Goal_y*dist2Goal_y);
	double dist2Goal_theta = atan2(dist2Goal_y, dist2Goal_x);

	// If too far, constant force
	if (dist2Goal_norm >= DSTARGOAL)
	{
		dist2Goal_x = cos(dist2Goal_theta);
		dist2Goal_y = sin(dist2Goal_theta);
	}
	else
	{
		// when close to target
		dist2Goal_x = 0;
		dist2Goal_y = 0;
	}

	// Final forces
	*force2Goal_x = dist2Goal_x * K_GOAL;
	*force2Goal_y = dist2Goal_y * K_GOAL;
	return;
}

// Compute the force from the opponents [Units in m]
static void force2Opp(double* force2Opp_x, double* force2Opp_y, double pos_x, double pos_y, double opp_x, double opp_y)
{
	// X and Y
	double dist2Opp_x = opp_x - pos_x;
	double dist2Opp_y = opp_y - pos_y;

	// Norm
	double dist2Opp_norm = sqrt(dist2Opp_x*dist2Opp_x + dist2Opp_y*dist2Opp_y);

	// If opponent is closed, forces are computed
	if (dist2Opp_norm < D_OPP)
	{
		*force2Opp_x = KOPP * (1 / dist2Opp_norm - 1 / D_OPP)*(dist2Opp_x) / (dist2Opp_norm*dist2Opp_norm*dist2Opp_norm);
		*force2Opp_y = KOPP * (1 / dist2Opp_norm - 1 / D_OPP)*(dist2Opp_y) / (dist2Opp_norm*dist2Opp_norm*dist2Opp_norm);
	}
	return;
}

void path_planning(CtrlStruct *cvs)
{
	// Definitions
	RobotPosition *rob_pos = cvs->rob_pos;
	PathPlanning *path = cvs->path;
	OpponentsPosition *opp_pos = cvs->opp_pos;
	// Variables
	static double last_speed_x = 0, last_speed_y = 0;
	double force2Goal_x, force2Goal_y, dist2Opp_x, dist2Opp_y, dist2Opp_norm, force2Opp_x = 0, force2Opp_y = 0;

	// Find the indices of the force_map corresponding to the actual position
	int indice_x = (rob_pos->y * M_TO_MM + 1500) * 63 / 3000;
	int indice_y = (rob_pos->x * M_TO_MM + 1000) * 43 / 2000;

	// Compute the forces from the goal and the opponent
	force2Goal(&force2Goal_x, &force2Goal_y, path->nextGoal[0], path->nextGoal[1], rob_pos->x*M_TO_MM, rob_pos->y*M_TO_MM);
	force2Opp(&force2Opp_x, &force2Opp_y, rob_pos->x, rob_pos->y, opp_pos->x[0], opp_pos->y[0]);

	// If there is no goal
	if ((force2Goal_x == 0) && (force2Goal_y == 0))
	{
		// Don't move
		path->linspeed = 0;
		last_speed_x = 0;
		last_speed_y = 0;
		return;
	}

	// Compute the speed in X and Y
	path->speed[0] = K_FROTT*last_speed_x + KPOT*(force_map[indice_x][indice_y][0]) + force2Goal_x - force2Opp_x;
	path->speed[1] = K_FROTT*last_speed_y + KPOT*(force_map[indice_x][indice_y][1]) + force2Goal_y - force2Opp_y;

	// Convert the speed X,Y -> Pho, Theta
	path->linspeed = K_VITESSE*sqrt(path->speed[0] * path->speed[0] + path->speed[1] * path->speed[1]);
	path->theta = atan2(path->speed[1], path->speed[0]);

	// Save the current speed
	last_speed_x = path->speed[0];
	last_speed_y = path->speed[1];
	return;
}


